import { connect } from 'react-redux';

class Table extends React.Component {
  render() {
    return (
      <table>
        <th>Test</th>
        <th>Test</th>
        <th>asd</th>
        <th>asd</th>
        <th>ggg</th>

        <th>Teaast</th>
        <th>aaa</th>
      </table>
    );
  }
}

export default connect()(Table);
